import React from 'react';
import Card from 'react-bootstrap/Card';

class Cliente extends React.Component{
    render() {
        return(
            <div className="PaginaCliente">
                <h1>BENVENUTO, {this.props.nome} {this.props.cognome}!</h1>
                <div className="row">
                    <div className="col">
                        <Card>

                        </Card>
                    </div>
                </div>
            </div>
        );
    }
}
export default Cliente;
